/**
 * 动态创建div，并弹出
 * @param objid 对象id
*/
function autowords(objid,event)
{
	var obj = document.getElementById(objid);
	if(!obj)return;
	var keyCode = event.keyCode ? event.keyCode : event.which ? event.which : event.charCode;
	if(keyCode == 9)closediv();
	if(obj.value.length<1){closediv();return;}/*判断文本框里是否有文字*/
	if(document.getElementById("autodiv"+objid)==null)/*判断是否已经创建过div*/
	{
	    var div = document.createElement("DIV");
	    div.setAttribute("id","autodiv"+objid);
	    var pos = getPosition(obj);
	    div.style.left = pos.x+"px";
        //div.style.width = obj.offsetWidth+"px";
        if(objid ==t1 || objid==t2)
        div.style.width = prot_width+"px";
        if(objid == t3)
        div.style.width = boat_width+"px";
        var h = pos.y + obj.offsetHeight;
        div.style.top = h +"px";
        div.style.visibility = "visible";
        div.style.position = "absolute";
        div.style.zIndex = "2";
	    div.style.overflow = "auto";
	    div.className ="autodiv";
	    div.style.border = "1px solid #000000";
		document.getElementById("no_div").appendChild(div);
        
    }
    //如果按下 向上, 向下 或 回车
    if (keyCode == 38 || keyCode == 40 ){
        SelectItem(keyCode,objid);/*注册键盘操作事件*/
    }
    else
    {
        if(keyCode == 13){ /*解决与输入法冲突*/
            if(currentIndex ==-1)
            {
                Get_Prot(objid);
             }
             else
            {
                SelectItem(keyCode,objid);/*注册键盘操作事件*/
            }
        }
        else
        {
            Get_Prot(objid);
        }
    }
}
function closediv()
{
    hidediv(t1);
    hidediv(t2);
    hidediv(t3);
    currentIndex = -1;
}
/**
 * 消除动态创建的div
*/
function hidediv(objid)
{
	var divobj = document.getElementById("autodiv"+objid);
	if(!divobj)return;
	divobj.parentNode.removeChild(divobj);
	currentIndex = -1;
}

/**
 * 获取控件绝对位置
 * @param obj 对象
 * @return 坐标x:_x, y:_y
*/
function getPosition(obj)
{
        var _x = 0;
        var _y = 0;
        while(null != obj.offsetParent){
            _x += obj.offsetLeft;
            _y += obj.offsetTop;
            obj = obj.offsetParent;
        }
        return {x:_x, y:_y};
}

